  false,\n\t\"url\": null,\n\t\"notes\": \"1. Unless additional salmon use data would
  indicate otherwise, harbor site 3 is considered the environmentally preferred alternative
  for construction of a small boat harbor. Should new data result in changing the
  Corps of Engineers' preferred alternative to harbor site 2, design changes should
  be made so that the wetlands adjacent to the site are not used for disposal of dredge
  spoils. Rather, the parking and staging area should be located in the upper intertidal
  zone because impacts to this impoverished benthic community would be substantially
  less than those to the wetlands. 2. Breakwaters at either harbor site should be
  designed to include breaches adequately sized to provide for unobstructed near shore
  movement of fishes and to permit water circulation that will maintain water quality
  within the mooring basin. 3. An additional site visit to the preferred quarry may
  be necessary depending upon the location and design of this project feature. Similarly,
  further field work could become necessary if dredge spoil quantities are too large
  to be utilized in the construction of staging and parking facilities and off-site
  disposal becomes necessary. Timing these field efforts to coincide with the occurrence
  of salmon smolts in Anchorage Bay would also permit data collection to better address
  that information gap.4. Fish and Wildlife Service personnel should be actively engaged
  in project planning in regards to both design and siting of project features.\",\n\t\"owner_org\":
